import React from "react";
import { makeStyles, Typography } from "@material-ui/core";

const useStyles = makeStyles({
  container: {
    width: "100vw",
    height: 1000,
    backgroundColor: "#01176C",
  },
  polygonBackground: {
    width: "100vw",
    height: 411,
    background: "transparent linear-gradient(180deg, #028D9ADE 0%, #8F749CE6 100%) 0% 0% no-repeat padding-box",
    clipPath: "polygon(0% 0%, 0% 100%, 15% 80%, 30% 90%, 45% 80%, 60% 90%, 75% 70%, 90% 80%, 100% 100%, 100% 0%)",
  },
});

const Intro: React.FC<{}> = () => {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <div className={classes.polygonBackground}></div>
    </div>
  );
};

export default Intro;
